import React from "react";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";

class Header extends React.Component {
  render() {
    return (
        <Navbar bg="primary" variant="dark">
          <Navbar.Brand href="/">
            <h3>Песочница</h3>
          </Navbar.Brand>

        </Navbar>
    );
  }
}
export default Header;
